(7592, 0, '【限量半价抢1000份，抢完恢复原价】【假一赔十】标婷维e乳100ml 维生素e乳VE乳液保湿补水面', 'http://omsproductionimg.yangkeduo.com/images/2017-11-02/718562226c5e5951422b05225314575f.jpeg', '<div class="goods-details-desc" style="border:0px;padding:14px 12px;margin:13px 10px;background-color:#FAFAFA;color:#666666;font-family:PingFangSC-Regular, Helvetica,;">\n	<div class="goods-details-desc-content" style="border:0px;padding:0px;margin:0px;text-align:justify;font-size:13px;">\n		商品规格 商品名称：标婷VE乳液 材质：本品富含维生素E等多种营养成分，能有效的进行肌肤深层的保湿与营养； 商品规格：100ml； 包装规格：带鸭嘴 带防护盖 商品描述 功能：用于皮肤干燥并有润肤,保湿作用，浴后使用； 效果：用于皮肤干燥、效果非常好； 长期使用：久用能令肌肤光洁、润泽、富于弹性； 更多描述 标婷护肤品能够满足各种类型皮肤在各个生理层面的需要，改善皮肤功能：保湿、止痒、抗衰、防晒、、防皲裂等等。产品具有舒适而天然的质地，能带来愉悦的使用感受。所有标婷护肤品全部在北医具有非常先进技术装备水平的净化车间里生产，严格保证每一支产品出厂的质量。 本品富含维生素E等多种营养成分，能有效的进行肌肤深层的保湿与营养。不含激素，宝宝孕妇可放心使用！用于皮肤干燥。久用能令肌肤光洁、净白、润泽、富于弹性。\n	</div>\n</div><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/0465eadc9a045af38d85ebfba948b384.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/e698c49a425c6ceb145386f00e4fb9c9.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/3d03cc8717fae9bc4e6154b54ae5ca6d.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/665bb01d6cf5a252a6f277e58768055f.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/7789798e6828f1cc75b2138a8fee68c1.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-05/553f1659598b9b7ffd45174e96a72d69.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" s