(7520, 0, '【全新升级一机多用 推荐选买一送八】家用面条机多功能压面机饺子皮机馄饨皮机不锈钢手动小型面皮机擀面机', 'http://omsproductionimg.yangkeduo.com/images/2017-11-08/6cc1f045a70e1ffa4aadbef41cbe0c87.jpeg', '<div class="goods-details-desc" style="border:0px;padding:14px 12px;margin:13px 10px;background-color:#FAFAFA;color:#666666;font-family:PingFangSC-Regular, Helvetica,;">\n	<div class="goods-details-desc-content" style="border:0px;padding:0px;margin:0px;text-align:justify;font-size:13px;">\n		1.全新升级家用多功能压面机，干净 健康 方便。推荐选旗舰款：买一送八，送花式模具2个+蝴蝶面模具2个+压饺子皮器+包饺子器+蛋清分离器+剥橙器；超值款：买一送六，送花式模具1个+蝴蝶面模具1个+压饺子皮器+包饺子器+蛋清分离器+剥橙器。一机多用，可做馄饨皮，饺子皮，蝴蝶面，小宽面，细面，烩面皮等。2.创新技术，加强型齿轮，加厚机身，采用不锈钢优质材质，精钢打造。 3.六大核心优势：材质优质，自选口味，一机多用，出面筋道，操作简单。4.六档调节厚度，可压面皮，饺子馄饨皮，您可以自主选择您所需要的面条厚度，代替传统压面方式，更加均匀，口感出众。5.可折叠面皮挡板，采用冷轧钢材料制作，光滑表面平整顺滑，有利于面块顺畅的通过，是现代主妇实用压面机。6.优质冷轧钢+防滑ABS手摇柄，经久耐用，手感舒适，安装操作更加简单。7.防滑底座设计，橡皮垫增设防滑颗粒，使压面机身更加稳固的固定在桌面，不易滑动。8.八大理由让您放心无忧：安全健康，操作稳定，齿轮加厚，外壳加厚，优质刀片，材料升级，质保无忧，收纳方便。\n	</div>\n</div><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/aff3b15ad0fe04cdda3e1d238d6c3e06.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/b906814241833c0cc0128ecad2f96b8a.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/2fb4800e45c216f24b4ffa7fb4490cbb.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/90ea16cfbae07ae4a689c85d7e9400ab.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/dd94324582945ff476d0bd6ccf178464.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-08-22/e00966bd4eda3bbac5a5923dd0853ad0.