(6488, 36, '【奥星 收纳袋】牛津布棉被子收纳袋防水储物行李袋衣物箱特大号装衣服的整理袋子', 'http://omsproductionimg.yangkeduo.com/images/2017-11-15/4e8b86a1e257af35440364946d802675.jpeg', '<div class="goods-details-desc" style="border:0px;padding:14px 12px;margin:13px 10px;background-color:#FAFAFA;color:#666666;font-family:PingFangSC-Regular, Helvetica,;">\n	<div class="goods-details-desc-content" style="border:0px;padding:0px;margin:0px;text-align:justify;font-size:13px;">\n		【破损一律包赔】小号适合春夏小件单薄衣服；中号适合冬天衣物； 大号适合装普通毛毯空调被以及3-5件大件衣物；特大号适合装6-8斤或者1.8米以内的普通被子；超大号适合装10斤以上或者1.8米以上的大被子！如果是装棉被，建议亲亲选购特大号或者超大号哦。\n本宝贝牛津布是210D，无骨架设计,经测试本款牛津布可以承受成年人120斤的重量不破损，相比无纺布，牛津布还具有轻薄，结实，耐用，可水洗等无纺布没有的优点哦，！注：拉链头由于批次不一样，拉链头心形，长方形随机发货哦。\n【支持7天无理由退换】\n	</div>\n</div><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/1b3e73b6211343274ded6dd2dcfc40a3.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/528e5582f72058af915f5766c9968eb1.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/0805e2c4f2097a489c45b310cc263ca5.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/b15c8f9a09a73f66b150cc83e260ea0c.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/77588e53e550452804c86e611094e15a.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/650c685ed3e5b08a98031711867df6b9.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-19/61c48e1d323ce34d63dd1d09d1c67a0d.jpeg" style="width: 640px