(7570, 0, '【正品带防伪】 韩束倍润亮颜修容红BB霜20ml 保湿不浮粉美白提亮肤色 强遮瑕脸部痘印斑点等瑕疵韩', 'http://omsproductionimg.yangkeduo.com/images/2017-10-29/b201ea3ff4141c931bdab4d59468a9b7.jpeg', '<div class="goods-details-desc" style="border:0px;padding:14px 12px;margin:13px 10px;background-color:#FAFAFA;color:#666666;font-family:PingFangSC-Regular, Helvetica,;">\n	<div class="goods-details-desc-content" style="border:0px;padding:0px;margin:0px;text-align:justify;font-size:13px;">\n		【正品带防伪】，韩束红BB霜20ml，一瓶19.9元，两瓶35.9元！\n天猫旗舰店40ml要119元，你还不赶紧拍个试试？】\n担心便宜彩妆伤害皮肤？担心擦了BB脸部太干、浮粉、太白过浮夸？担心普通BB遮不掉通宵的黑眼圈及脸部的痘印斑点和暗黄肤色？\n这些通通没有关系，一瓶【韩束红BB霜】扫除你所有顾虑！！我们产品属于韩束大品牌，明星景甜郭采洁代言十几亿广告投入，质量保证质检齐全，【带有防伪标查询】！！\n韩束王牌BB霜，7分养3分妆！多种植物精华，姜根提取能保持水油平衡，留住皮肤水份，保湿不浮粉，化妆同时也能护肤，持久定妆，保持一整天的美丽！升级版的红BB霜，质感更细腻，能更好的在脸上轻易抹开不卡粉，同时有效提亮暗黄肤色，美白皮肤，而且妆容自然，让你做“素颜女神”！同时红BB霜拥有超好的遮瑕效果，一抹轻松遮掉脸部痘印、斑点、黑眼圈等瑕疵，让你和明星一样，拥有无瑕美肌！\n【挤出适量于手背或者指腹，按顺序由脸颊额头，由内而外轻拍或按压，完成后，用温热的手掌或化妆棉轻轻按压全脸，可以让BB霜更服帖！】\n\n	</div>\n</div><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-23/8d8b5210a38286642dd68c5b6587da63.png" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-29/cb98dee8d6807e10f9ed0313dff89975.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-29/40e31dbb6f5e3c7400dec590f35c710e.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-29/073123b84b3dcdaf0c1f1dd990ccf767.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-29/8ffad197f9f3b6f99b61747a099f20d1.jpeg" style="width: 640px; height: auto; padding-top: 0px; margin-left: 0px;"><img class="gd-img" src="http://omsproductionimg.yangkeduo.com/images/2017-10-29/b908b24d52c60108b453c6395783f